import { Paper } from '@mui/material';
import * as React from 'react';
import './CardStyles/HomePageCard.scss';


export default function HomePageCardImage({image}) {
  return (
    <>
        <Paper elevation={0}>
            <img className='HomePageCardImage' src={image} />
        </Paper>


    </>
  );
}
